Not able to add todos to database<p>I'm trying to write the code for my todo app in React. </p>

<p>I can't seem to add a new todo to my database with the handleSubmit function. However, when I use Postman, a todo gets added, but for some sort of reason it doesn't work when I try entering a todo in the input field on my app and submit it. Anyone that can see what's wrong?</p>

<hr>

<p><strong>Todo.js component - FRONT-END</strong></p>

<pre><code>import React from 'react'
import './Todo.css'  
import Todoitem from '../components/Todoitem'
import axios from 'axios'
import qs from "qs"
import DefaultLayout from "../layout/Default"

class Todo extends React.Component {
    constructor() {
        super()

        this.state = {
            title:"",
            todos:[]
        }
        this.handleChange=this.handleChange.bind(this)
        this.handleSubmit=this.handleSubmit.bind(this)
    }

    componentDidMount(){
        axios({
            method: "GET",
            url: `${process.env.REACT_APP_API_BASE}/todo`,
            withCredentials: true
        })
            .then(response =&gt; {
            console.log(response)
            let todolist = response.data;
            this.setState({todos:todolist})
        })
        .catch(error =&gt; {
            console.log("You've made an error when getting the todos charles: ",error)
        })
    }

    handleChange(event){
        event.preventDefault()
        let name = event.target.name
        let value = event.target.value
        this.setState({
            [name]:value
        })
        console.log(this.state.title)
    }

    handleSubmit(event){
        event.preventDefault()
        if (!this.state.title) {
            debugger
        }  
        axios({
            method: "POST",
            url: `${process.env.REACT_APP_API_BASE}/todo`,
            data: qs.stringify({title: this.state.title}),
            headers: {"content-type": "application/x-www-form-urlencoded"},
            withCredentials: true
        })
        .then((response) =&gt; {
            console.log(response)
        })
        .catch((error) =&gt; {
            console.log(error.response)
        })
    }

    handleDelete(todoId){
        axios
        .delete(`${process.env.REACT_APP_API_BASE}/todo/${todoId}`)
        .then(response =&gt; {
            const remainingTodos = this.state.todos.filter(element =&gt; element._id !== todoId)
            this.setState({
                todos: remainingTodos
            })
        })
        .catch(err =&gt; console.log(err))
    }

    render() {
        return (
            &lt;div&gt;
                &lt;DefaultLayout&gt;
                &lt;h1&gt;To-do things for this app&lt;/h1&gt;
                &lt;h2 className="todotitle"&gt;Add your to-do here, Charles!&lt;/h2&gt;
                &lt;form className="todocontainer" onClick={this.handleSubmit}&gt; 
                    &lt;div className="inputbuttonandfield"&gt;    
                        &lt;div className="inputcontainer"&gt;
                            &lt;form className="captionpart"&gt;
                                &lt;label className="captionlabel" htmlFor="title"&gt;Add to-do:&lt;/label&gt;&lt;br&gt;&lt;/br&gt;
                                &lt;input className="captionform" type="text" name="title" value={this.state.title} placeholder="Type your to-do here!" onChange={(e) =&gt; this.handleChange(e)}&gt;&lt;/input&gt;
                            &lt;/form&gt;
                        &lt;/div&gt;

                        &lt;button className="shootbutton"&gt;Add!&lt;/button&gt;
                    &lt;/div&gt;
                &lt;/form&gt; 

                {
                    this.state.todos.map(element=&gt; (
                     &lt;div className="todosoverviewlister"&gt;
                        &lt;Todoitem key={element._id} id={element._id} title={element.title} /&gt;

                        &lt;button className="tododelete" onClick={()=&gt; this.handleDelete(element._id)}&gt;Delete&lt;/button&gt;
                     &lt;/div&gt;
                    ))
                }

                &lt;/DefaultLayout&gt;
            &lt;/div&gt;
        )
    }
}

export default Todo
</code></pre>

<hr>

<p><strong>Todo - model</strong></p>

<pre><code>const mongoose = require("mongoose")
const Schema = mongoose.Schema

const todoSchema = new Schema({
    title: String
})

const Todo = mongoose.model("todos",todoSchema)

module.exports = Todo
</code></pre>

<hr>

<p><strong>INDEX.js - backend</strong></p>

<pre><code>//add to-do
router.post("/todo", (req,res) =&gt; {
  Todo
  .create({
    title: req.body.title
  })
  .then((response) =&gt; {
    console.log("Charles the post todo is working")
    res.json(response)
  })
  .catch(error =&gt; {
    console.log("Charles the post todo is NOT working")
    res.json(error)
  })
})

//request todos
router.get("/todo", (req,res) =&gt; {
  Todo
  .find()
  .then(response =&gt; {
    res.json(response)
  })
  .catch(error =&gt; {
    res.json(error)
  })
})
</code></pre>

