How can we retain only unique documents in mongodb aggregation<p>How can we retain all values even after using $group stage in case we need to use lookup in two collections.
i.e suppose i have two sample collections
<strong>col1</strong></p>

<pre><code>name: 'abc',
phoneNo:888######4,
vCode:20166,
dcode:30166,
city:'city1',
profession:'profession1'


name: 'name1',
phoneNo:999######1,
vCode:20167,
dcode:30166,
city:'city2',
profession:'profession2'


name: 'abc',
phoneNo:888######4,
vCode:20166,
dCode:30166
city:'city1'
profession:'profession1'
</code></pre>

<p><strong>col2</strong></p>

<pre><code>name:'name1'
phoneNo:'999######1'
dCode:30166,
vCode:20167
profession:'profession2'
</code></pre>

<p>I have 3 docs in col1 out which 2 docs are duplicate.Now i needed to find out the docs which are not present in col2.Below is the query i have constructed.</p>

<pre><code>db.col1.aggregate([
   { 
        $lookup: {
            from: "col2",
            let: {
                vCode: '$vCode',
                dCode: '$dCode',
            },
            pipeline: [
                {
                    $match: {
                        $expr: {
                            $and: [
                                { $eq: ["$dCode", "$$dCode"] },

                                { $eq: ["$vCode", "$$vCode"] }

                            ]
                        }
                    }
                },

            ],
            as: "col2"
        }
    },
    {
        $match: { col2: [] }
    }, {
        $project: {
           col2: 0
        }
    }
])
</code></pre>

<p>Now the above query does returns all the documents which are not present in col2.
But as there are two duplicate documents in col1 hence the query returns both the documents too.Any suggestions how can i filter out duplicate documents and retain only unmatched and unique documents.</p>

