Count documents based on Array value and inner Array value<p>Before I explain my use case, I'd like to state that yes, I could change this application so that it would store things in a different manner or even split it into 2 collections for that matter. But that's not my intention, and I'd rather want to know if this is at all possible within MongoDB (since I am quite new to MongoDB). I can for sure work around this problem if I'd really need to, but rather looking for a method to achieve what I want (no I am not being lazy here, I really want to know a way to do this).</p>

<p>Let's get to the problem then.
I have a document like below:</p>

<pre><code>{
    "_id" : ObjectId("XXXXXXXXXXXXXXXXXXXXX"),
    "userId" : "XXXXXXX",
    "licenses" : [
            {
                    "domain" : "domain1.com",
                    "addons" : [
                            {"slug" : "1"},
                            {"slug" : "2"}
                    ]
            },
            {
                    "domain" : "domain2.com",
                    "addons" : [
                            {"slug" : "1"},
                    ]
            }
    ]
}
</code></pre>

<p>My goal is to check if a specific domain has a specific addon. When I use the below query to count the documents with domain: <code>domain2.com</code> and addon slug: <code>2</code> the result should be: <code>0</code>. However with the below query it returns <code>1</code>. I know that this is because the query is executed document wide and not just the license index that matched <code>domain2.com</code>. So my question is, how to do a sub <code>$and</code> (or however you'd call it)?</p>

<pre><code>db.test.countDocuments(
    {$and: [
        {"licenses.domain": "domain2.com"}, 
        {"licenses.addons.slug": "2"}, 
