        {
            "licenses.domain": "domain2.com",
            $and: [
                { "licenses.addons.slug": "2"} 
            ]
        }
    ]}
)
</code></pre>

<p>I know there is <code>$group</code> and <code>$filter</code> operators, I have been trying many combinations to no avail. I am lost at this point, I feel like I am completely missing the logic of Mongo here. However I believe this must be relatively easy to accomplish with a single query (just not for me I guess).</p>

<p>I have been trying to find my answer on the official documentation and via stack overflow/google, but I really couldn't find any such use case.</p>

<p>Any help is greatly appreciated! Thanks :)</p>

