const lastOneHr = new Date().getTime() - 60 * 60 * 1000;

//get chart info
router.post("/getcustomerchart/:adminId", (req, res, next) =&gt; {
  const adminId = req.params.adminId;
  Customer.aggregate([
    {
      $facet: {
        today: [
          {
            $match: {
              $and: [
                { adminId: adminId },
                { updated: { $gte: start, $lte: end } },
              ],
            },
          },
          { $count: "count" },
        ],
        lastHour: [
          {
            $match: {
              $and: [
                { adminId: adminId },
                { updated: { $gte: lastOneHr, $lte: now } },
